import React,{useState,useEffect} from 'react';
import {Table,Button} from 'react-bootstrap';

function CurrentAlgos(props) {
  const [currentAlgos,setCurrentAlgos] = useState([]);

  useEffect(()=>{
    fetchData();
  },[]);

  const fetchData = async() => {
    fetch('http://127.0.0.1:5000/getalgos')
      .then(response=>response.json())
      .then(data=>{
        console.log(data)
        setCurrentAlgos(data)
      })
  }



  return (
    <div>

        <Table striped bordered hover>
          <thead>
            <tr>
              <th>Name</th>
              <th>Security1</th>
              <th>Security2</th>
            </tr>
          </thead>
          <tbody>

              {currentAlgos.map((item,key)=>(
                <tr key ={key}>
                  <td>{item.name}</td>
                  <td>{item.security1}</td>
                  <td>{item.security2}</td>
                  <td>
                    <Button>Add</Button>
                    <span>    </span>
                    <Button>Withdraw</Button>
                  </td>
                </tr>
                ))}

          </tbody>
        </Table>
    </div>
  );
}

export default CurrentAlgos;
